  [],\n\t\"revision_timestamp\": \"2015-05-07T15:21:57.053003\",\n\t\"name\": \"uas-demand-generation-and-airspace-performance-impact-prediction-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The key innovation of this effort is the
  development of future traffic demand for Uninhabited Aerial Systems (UAS) given
  the various missions they intend to fly, and thereafter populating a data warehouse
  with these projected flights that can be marketed to the aviation community.  We
  propose developing one flight demand set for each of twenty-five future years from
  the 2015 through 2040, incorporating nineteen of the proposed UAS missions (sixteen
  to be developed during Phase II and three already completed from the Phase I activity,
  for a total of 19 missions * 25 years = 475 demand sets available at the conclusion
  of the project).  In developing these demand sets, we are capitalizing on new technologies
  prototyped and demonstrated in Phase I of this project, in which our team demonstrated
  that credible flight demand sets for UAS missions can be developed using a combination
  of socioeconomic modeling combined with techniques derived from the activity-based
  modeling community.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
